import React from 'react';
import FooterTopBg from '../../assests/bg-footer-top-mobile.svg';
import { Footer, FooterTop, Image } from '../../components/styles/HuddleFooter.styled';
import Contact from '../../components/Contact/Contact';
import Newsletter from '../../components/Newsletter/Newsletter';

const HuddleFooter = (props) => {
    return (
        <Footer>
            <Image Src={FooterTopBg} />

            <Contact />
            <Newsletter />
        </Footer >
    );
}

export default HuddleFooter;
